import React from 'react';
import './Header.css';
import logo from './logo.png';

const Header = () => {
  return (
    <header>
      <nav>
        <ul className="nav-links">
          <li>
            <div className="logo-container">
              <img src={logo} alt="Logo" className="logo" />
            </div>
          </li>
          <li>
            <a href="#">Home</a>
          </li>
          <li>
            <a href="#">About</a>
          </li>
          <li>
            <a href="#">Careers</a>
          </li>
          <li>
            <a href="#">Contact Us</a>
          </li>
          {/* Add more links as needed */}
        </ul>
      </nav>
    </header>
  );
};

export default Header;
